export default function IONode({ data }) {
    return (
      <div style={{
        border: '2px solid #4a4',
        padding: 10,
        transform: 'skewX(-20deg)',
        background: '#efe'
      }}>
        <div style={{ transform: 'skewX(20deg)' }}>
          {data.label}
        </div>
      </div>
    );
  }
